import * as React from 'react';
import { styled } from '../stitches.config';

const AppContainer: React.FC = ({ children }) => {
	return (
		<Background>
			{children}
		</Background>
	);
};

export default AppContainer;

const Background = styled('div', {
	width: '100vw',
	height: '100vh',
});
